import React from "react";
import "../css/About.css"
import introphoto from "../../photo/me.jpg"
import { Link } from 'react-router-dom';

const About = () => {
    return (
         <div className="container_about">
            <h2 className="title">-ABOUT-</h2>
            <div className="profile">
                <p className="profile-img">
                    <img src={introphoto} alt="" className="me"/>
                </p>
                <div className="profile-body">
                    <p>
                        木嶋陸<br/>新潟県出身。21歳。現在は新潟大学を休学し(4年生、25卒)、プログラミングの勉強に励んでいます。
                    </p>
                    <p>
                        カメラが趣味なので、自分が撮影した写真を用いてライブラリーを作成してみました。<Link  className="here" to="/photo_library">→こちら</Link>
                    </p>
                </div>
            </div>
         </div>

    )
};

export default About;
